import React from "react";
import userService from "../../services/UserService";

const Products = () => {
  const [data, setData] = React.useState([]);
  return (
    <>
      <h1 style={{ backgroundColor: "ghostwhite" }}>Landing page 2</h1>
      <button
        onClick={() => {
          console.log("Event Hits");
          userService
            .getCourse()
            .then((res) => {
              setData(res.data);
              console.log(data);
            })
            .catch((err) => {
              console.log("error " + err);
            });
        }}
      >
        Testing
      </button>
    </>
  );
};

export default Products;
